pragma solidity ^0.8.0;

contract EnergyManagement {

    struct EV {
        uint EV_ID;
        uint soc;
        uint capacity;
        uint energy_coins;
        string gps_location;
        uint pay_off_value;
    }

    struct CS {
        uint CS_ID;
        uint capacity;
        uint load;
        uint max_load;
        string gps_location;
        uint[] scheduled_EVs;
    }

    EV[] public EVs;
    CS[] public CSs;

    function scheduleEVs() external {
        uint numEvs = EVs.length;
        uint numCss = CSs.length;
        uint M = numCss; // Number of CSs

        for (uint evIndex = 0; evIndex < numEvs; evIndex += M) {
            uint remainingEvs = numEvs - evIndex;
            uint numScheduledEvs = remainingEvs >= M ? M : remainingEvs;

            EV[] memory chosenEvs = new EV[](numScheduledEvs);
            for (uint i = 0; i < numScheduledEvs; i++) {
                chosenEvs[i] = EVs[evIndex + i];
            }

            for (uint i = 0; i < numScheduledEvs; i++) {
                EV memory ev = chosenEvs[i];
                uint energyNeeded = (100 - ev.soc) * ev.capacity;

                uint minLoad = type(uint).max;
                uint minDistance = type(uint).max;
                uint chosenCsIndex = type(uint).max;

                // Find CS with minimum load and minimum distance
                for (uint csIndex = 0; csIndex < numCss; csIndex++) {
                    CS storage cs = CSs[csIndex];

                    uint energyAvailable = cs.capacity - cs.load;
                    uint distance = calculateDistance(ev.gps_location, cs.gps_location);

                    if (energyAvailable >= energyNeeded && cs.load <= minLoad && distance < minDistance && cs.load <= cs.max_load) {
                        minLoad = cs.load;
                        minDistance = distance;
                        chosenCsIndex = csIndex;
                    }
                }

                // If a suitable CS is found, schedule the EV
                if (chosenCsIndex < numCss) {
                    CS storage chosenCs = CSs[chosenCsIndex];
                    chosenCs.load += energyNeeded;
                    chosenCs.scheduled_EVs.push(ev.EV_ID);
                }
            }
        }
    }

